def inv(word):
    new_word=''
    for letter in word:
        if letter.lower() == letter:
            new_word += letter.upper()
        else:
            new_word += letter.lower()
    return new_word

def concat(word1,word2):
    redword1 = word1
    redword2 = word2
    while (len(redword1)>0 and len(redword2)>0 and redword1[-1] == inv(redword2[0])):
        redword1 = redword1[:-1]
        redword2 = redword2[1:]
    return redword1 + redword2

def reduce(word):
    if len(word) <= 1:
        return word
    word1 = word[:len(word)//2]
    word2 = word[len(word)//2:]
    red1 = reduce(word1)
    red2 = reduce(word2)
    return concat(red1,red2)

def remove(word, letter):
    return ''.join([l for l in word if l.lower()!=letter])

def best_reduce(word):
    #Finds the letter such that after deleting it and
    #reducing gives the shortest word
    red = reduce(word)
    best='a'
    bestlen=len(reduce(remove(red,'a')))
    for l in 'bcdefghijklmnopqrstuvwxyz':
        length = len(reduce(remove(red,l)))
        if length < bestlen:
            best=l
            bestlen = length
    return (best, bestlen)
               

    

